script: |
  super -f text -I q5525.spq | sort > q5525.out

inputs:
  - name: q5525.spq
    data: |
      SELECT DISTINCT + col0 + + 70 FROM tab1 (FORMAT parquet) WHERE + - col0 NOT BETWEEN - col2 / - ( col0 ) AND ( - - col1 );
  - name: tab1

outputs:
  - name: q5525.out
    data: |
      121
      155
      161
